import { Card, EmptyState, Layout, Page } from '@shopify/polaris';


const Bing = () => (
    <Page>
        <Layout>
            <Layout.AnnotatedSection
            title="I just want to say"
            description="Maybe um."
          >
            <Card sectioned>
                <p>Whee</p>
            </Card>
            </Layout.AnnotatedSection>
        </Layout>
    </Page>
);

export default Bing;
